import {
    container as stlye_container
} from './index.module.css';

const FilmCard = ({
    title,
    index,
    image
}) => {
    return <div
        key={'films-' + index}
        className={stlye_container}
    >
        <img
            src={image}
            height="250px"
        />
        <span>{title}</span>
        <p className="" />
    </div>
};
export default FilmCard;
